import React from "react";

export default function Wrapper({  property, children, onClick, clickable, objectPath }: { onClick?: (objectPath: string) => void, property: string, children: React.ReactNode, clickable: boolean, objectPath: string }){
    return <div className="indented">
      <span className={clickable ? "clickable-property key" : "key"}
      onClick={() => onClick(objectPath)}
      >{property}: </span>
      {children},
    </div>
  }
